import React from "react";

const ExpenseForm=()=>{
    return (
        <form>
            div.new_expense__control

            <label>Title</label>
            <input type='text'/>

            <label>Amount</label>
            <input type="number" min="0.01" step="0.01" />

            <label>Date</label>
            <input type="date" min="2020-01-01" max="2023-12-31" />

            <button type="submit">Add Expense</button>
        </form>
    )
}

export default ExpenseForm
